// SPDX-License-Identifier: MIT
pragma solidity >=0.8.12 <0.9.0;

import {Ownable} from "../../../abstract/Ownable.sol";

import {DATABASE_KEY} from "../../../constant/SecretKey.sol";

import {BusinessPost, Status} from "../../../struct/business/post/PostStruct.sol";

contract ListBusinessPost is Ownable {
    mapping(uint256 => BusinessPost) private list;
    uint256 private autoIncrement = 0;

    constructor() Ownable() {}

    event Add(BusinessPost item);

    event Remove(BusinessPost item);

    modifier requestSecretkey(bytes32 value) {
        require(
            value == DATABASE_KEY,
            "Database ListBusinessPost: Secret key error"
        );
        _;
    }

    modifier validIndex(uint256 index) {
        require(
            (1 <= index) && (index <= autoIncrement),
            "Database ListBusinessPost: Invalid index"
        );
        _;
    }

    function getLength(bytes32 secret)
        public
        view
        requestSecretkey(secret)
        returns (uint256)
    {
        return autoIncrement;
    }

    function add(BusinessPost memory item, bytes32 secret)
        public
        requestSecretkey(secret)
        returns (uint256)
    {
        autoIncrement++;
        item.businessPostId = autoIncrement;
        list[autoIncrement] = item;
        emit Add(item);
        return autoIncrement;
    }

    function at(uint256 index, bytes32 secret)
        public
        view
        requestSecretkey(secret)
        validIndex(index)
        returns (BusinessPost memory)
    {
        return list[index];
    }

    function hide(uint256 index, bytes32 secret)
        public
        requestSecretkey(secret)
        validIndex(index)
        returns (bool)
    {
        BusinessPost memory gap = BusinessPost(
            0,
            0,
            "",
            0,
            "",
            "",
            "",
            Status.close
        );
        list[index] = gap;
        return true;
    }

    // Setter
    function setStatus(
        uint256 index,
        bytes32 secret,
        Status value
    ) public requestSecretkey(secret) validIndex(index) returns (bool) {
        list[index].status = value;
        return true;
    }
}

