// SPDX-License-Identifier: MIT
pragma solidity >=0.8.14 <0.9.0;

enum Status {
    open,
    close,
    upcoming
}
struct BusinessPost {
    uint256 id;
    uint256 businessPostId;
    string hashTag;
    uint256 time;
    string content;
    string imageSource;
    string job;
    Status status;
}

